import React, { Component } from "react";
import Box from "../Box/Box";

import "./Grid.css";
class Grid extends Component {
  constructor(props) {
    super(props);
    this.AddRow();
  }
  render() {
    return (
      <div id="GridBody">
        <table id="grid">
            <tr>
              <Box />
              <Box />
            </tr>
            <tr>
              <Box />
              <Box />
            </tr>
        </table>
      </div>
    );
  }

  AddRow(){
    let tableRef = document.getElementById("grid");

    let newRow = tableRef.insertRow(-1);
    let newCell = newRow.insertCell(0);
    newCell.appendChild(<Box />);
  }
  PrintEle(ele) {
    console.log(ele);
  }
}

export default Grid;
